import img from './dog.jpg'

import React from 'react';

// export default function Dog({x,y}){//将拿到的参数结构为x，y
export default function Dog(props){//将拿到的参数结构为x，y
  return (
    <div>
      <img
        src={img}
        alt=""
        style={{
          width: 100,
          height: 100,
          left: props.x,
          top:props.y,
          position:'absolute'
        }}
      />
    </div>
  )
}
